static void botje_parm_pdf(const LHAPDF_FLOAT *fp, double x, double *f)
{
  double uv, dv, g, du, se;

  uv = lhpdf_x_taylor(x, fp, 1.0, 4, 0,1,2,3);
  dv = lhpdf_x_taylor(x, fp, 1.0, 4, 4,5,6,7);
  du = lhpdf_x_taylor(x, fp, 1.0, 3, 8,9,10);
  se = lhpdf_x_taylor(x, fp, 1.0, 4, 11,12,13,14);
  g  = lhpdf_x_taylor(x, fp, 1.0, 4, 15,16,17,18);
 
  f[-6] = f[6] = 0.0;
  f[-5] = f[5] = 0.0;
  f[-4] = f[4] = 0.0;
  f[-3] = f[3] = 0.2*se;
  
  f[-2] = -0.5*du+0.15*se;
  f[-1] =  0.5*du+0.15*se;
  f[0] = g;
  f[1] = dv+f[-1];
  f[2] = uv+f[-2]; 
}


